import React from "react";
import Styles from "./Table.module.scss";
import * as ReactBootStrap from "react-bootstrap";

const Table = (props) => {
    const items = props
    function populateRow(itemObject) {
        const { item, partNo, sku, listed, datePurchased,
            dateSold, purchasePrice, priceSold, shippingCost,
            ebayFees, payPaylFees, profit, id } = itemObject;
        return (
            <tr key={id}>
                <td>{item}</td>
                <td>{partNo}</td>
                <td>{sku}</td>
                <td>{listed}</td>
                <td>{datePurchased}</td>
                <td>{dateSold}</td>
                <td>{purchasePrice}</td>
                <td>{priceSold}</td>
                <td>{shippingCost}</td>
                <td>{ebayFees}</td>
                <td>{payPaylFees}</td>
                <td>{profit}</td>
            </tr>
        )
    }
    return (
        <div className={Styles.wrapper}>
            <ReactBootStrap.Table striped bordered hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>First Name</th>
                        <th>Last Name</th>
                        <th>Username</th>
                    </tr>
                </thead>
                <tbody>
                    {items}
                </tbody>
            </ReactBootStrap.Table>
        </div>
    );
}

export default Table;
